"use strict";(self.webpackChunkunesco=self.webpackChunkunesco||[]).push([[944],{944:t=>{t.exports=JSON.parse('[{"year1":"1978","title1":"\u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u041c\u0435\u0441\u0430 \u0412\u0435\u0440\u0434\u0435","text1":"\u041d\u0430 \u043f\u043b\u0430\u0442\u043e \u041c\u0435\u0441\u0430-\u0412\u0435\u0440\u0434\u0435 \u043d\u0430 \u043f\u0456\u0432\u0434\u0435\u043d\u043d\u043e\u043c\u0443 \u0437\u0430\u0445\u043e\u0434\u0456 \u041a\u043e\u043b\u043e\u0440\u0430\u0434\u043e \u043d\u0430 \u0432\u0438\u0441\u043e\u0442\u0456 \u043f\u043e\u043d\u0430\u0434 2600 \u043c \u043d\u0430\u0434 \u0440\u0456\u0432\u043d\u0435\u043c \u043c\u043e\u0440\u044f \u043c\u043e\u0436\u043d\u0430 \u0437\u043d\u0430\u0439\u0442\u0438 \u0437\u043d\u0430\u0447\u043d\u0443 \u043a\u043e\u043d\u0446\u0435\u043d\u0442\u0440\u0430\u0446\u0456\u044e \u0436\u0438\u0442\u043b\u0430 \u043f\u0440\u0435\u0434\u043a\u0456\u0432 \u0456\u043d\u0434\u0456\u0430\u043d\u0446\u0456\u0432 \u043f\u0443\u0435\u0431\u043b\u043e, \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u0438\u0445 \u0437 6 \u043f\u043e 12 \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f. \u0411\u0443\u043b\u043e \u0437\u0430\u0440\u0435\u0454\u0441\u0442\u0440\u043e\u0432\u0430\u043d\u043e \u0431\u043b\u0438\u0437\u044c\u043a\u043e 4400 \u043c\u0456\u0441\u0446\u044c, \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0447\u0438 \u0441\u0435\u043b\u0430, \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u0456 \u043d\u0430 \u0432\u0435\u0440\u0448\u0438\u043d\u0456 \u041c\u0435\u0437\u0438. \u0404 \u0442\u0430\u043a\u043e\u0436 \u0432\u0435\u043b\u0438\u0447\u043d\u0456 \u043a\u0430\u043c\u2019\u044f\u043d\u0456 \u0431\u0443\u0434\u0438\u043d\u043a\u0438 \u043d\u0430 \u0441\u043a\u0435\u043b\u044f\u0445, \u044f\u043a\u0456 \u0441\u043a\u043b\u0430\u0434\u0430\u044e\u0442\u044c\u0441\u044f \u0437 \u043f\u043e\u043d\u0430\u0434 100 \u043a\u0456\u043c\u043d\u0430\u0442.","year2":"1978","title2":"\u0404\u043b\u043b\u043e\u0443\u0441\u0442\u043e\u043d\u0441\u044c\u043a\u0438\u0439 \u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a","text2":"\u0412\u0435\u043b\u0438\u0447\u0435\u0437\u043d\u0438\u0439 \u043f\u0440\u0438\u0440\u043e\u0434\u043d\u0438\u0439 \u043b\u0456\u0441 \u0404\u043b\u043b\u043e\u0443\u0441\u0442\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u0430\u0440\u043a\u0443 \u0437\u0430\u0439\u043c\u0430\u0454 \u043c\u0430\u0439\u0436\u0435 9000 \u043a\u043c2; 96% \u043f\u0430\u0440\u043a\u0443 \u0437\u043d\u0430\u0445\u043e\u0434\u0438\u0442\u044c\u0441\u044f \u0443 \u0412\u0430\u0439\u043e\u043c\u0456\u043d\u0433\u0443, 3% \u0443 \u041c\u043e\u043d\u0442\u0430\u043d\u0456 \u0442\u0430 1% \u0443 \u0410\u0439\u0434\u0430\u0445\u043e. \u0404\u043b\u043b\u043e\u0443\u0441\u0442\u043e\u0443\u043d \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0443 \u0432\u0441\u0456\u0445 \u0432\u0456\u0434\u043e\u043c\u0438\u0445 \u0443 \u0441\u0432\u0456\u0442\u0456 \u0433\u0435\u043e\u0442\u0435\u0440\u043c\u0430\u043b\u044c\u043d\u0438\u0445 \u043e\u0431\u2019\u0454\u043a\u0442\u0456\u0432, \u043d\u0430\u043b\u0456\u0447\u0443\u044e\u0447\u0438 \u043f\u043e\u043d\u0430\u0434 10 000 \u043f\u0440\u0438\u043a\u043b\u0430\u0434\u0456\u0432. \u0422\u0443\u0442 \u0442\u0430\u043a\u043e\u0436 \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448\u0435 \u0443 \u0441\u0432\u0456\u0442\u0456 \u0441\u043a\u0443\u043f\u0447\u0435\u043d\u043d\u044f \u0433\u0435\u0439\u0437\u0435\u0440\u0456\u0432 (\u043f\u043e\u043d\u0430\u0434 300 \u0433\u0435\u0439\u0437\u0435\u0440\u0456\u0432, \u0430\u0431\u043e \u0434\u0432\u0456 \u0442\u0440\u0435\u0442\u0438\u043d\u0438 \u0432\u0441\u0456\u0445 \u043d\u0430 \u043f\u043b\u0430\u043d\u0435\u0442\u0456). \u0417\u0430\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0439 \u0443 1872 \u0440\u043e\u0446\u0456 \u0404\u043b\u043b\u043e\u0443\u0441\u0442\u043e\u0443\u043d \u0442\u0430\u043a\u043e\u0436 \u0432\u0456\u0434\u043e\u043c\u0438\u0439 \u0441\u0432\u043e\u0454\u044e \u0434\u0438\u043a\u043e\u044e \u043f\u0440\u0438\u0440\u043e\u0434\u043e\u044e, \u044f\u043a-\u043e\u0442 \u0432\u0435\u0434\u043c\u0435\u0434\u0456 \u0433\u0440\u0456\u0437\u043b\u0456, \u0432\u043e\u0432\u043a\u0438, \u0431\u0456\u0437\u043e\u043d\u0438 \u0442\u0430 \u0432\u0430\u043f\u0456\u0442\u0456."},{"year1":"1979","title1":"\u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u0415\u0432\u0435\u0440\u0433\u043b\u0435\u0439\u0434\u0441","text1":"\u0426\u0435 \u043c\u0456\u0441\u0446\u0435 \u043d\u0430 \u043f\u0456\u0432\u0434\u0435\u043d\u043d\u043e\u043c\u0443 \u043a\u0440\u0430\u044e \u0424\u043b\u043e\u0440\u0438\u0434\u0438 \u043d\u0430\u0437\u0438\u0432\u0430\u044e\u0442\u044c \xab\u0440\u0456\u0447\u043a\u043e\u044e \u0442\u0440\u0430\u0432\u0438, \u044f\u043a\u0430 \u043d\u0435\u043f\u043e\u043c\u0456\u0442\u043d\u043e \u0442\u0435\u0447\u0435 \u0437 \u0433\u043b\u0438\u0431\u0438\u043d\u043a\u0438 \u0432 \u043c\u043e\u0440\u0435\xbb. \u0412\u0438\u043d\u044f\u0442\u043a\u043e\u0432\u0430 \u0440\u0456\u0437\u043d\u043e\u043c\u0430\u043d\u0456\u0442\u043d\u0456\u0441\u0442\u044c \u0439\u043e\u0433\u043e \u0432\u043e\u0434\u043d\u0438\u0445 \u0441\u0435\u0440\u0435\u0434\u043e\u0432\u0438\u0449 \u0437\u0440\u043e\u0431\u0438\u043b\u0430 \u0439\u043e\u0433\u043e \u0437\u0430\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u043e\u043c \u0434\u043b\u044f \u0432\u0435\u043b\u0438\u043a\u043e\u0457 \u043a\u0456\u043b\u044c\u043a\u043e\u0441\u0442\u0456 \u043f\u0442\u0430\u0445\u0456\u0432 \u0456 \u0440\u0435\u043f\u0442\u0438\u043b\u0456\u0439, \u0430 \u0442\u0430\u043a\u043e\u0436 \u0434\u043b\u044f \u0432\u0438\u0434\u0456\u0432, \u044f\u043a\u0438\u043c \u0437\u0430\u0433\u0440\u043e\u0436\u0443\u0454 \u0437\u043d\u0438\u043a\u043d\u0435\u043d\u043d\u044f, \u0442\u0430\u043a\u0438\u0445 \u044f\u043a \u043b\u0430\u043c\u0430\u043d\u0442\u0438\u043d.","year2":"1979","title2":"\u0417\u0430\u043b \u041d\u0435\u0437\u0430\u043b\u0435\u0436\u043d\u043e\u0441\u0442\u0456","text2":"\u0423 \u0446\u0456\u0439 \u0431\u0443\u0434\u0456\u0432\u043b\u0456 \u0443 \u0424\u0456\u043b\u0430\u0434\u0435\u043b\u044c\u0444\u0456\u0457 \u0431\u0443\u043b\u0438 \u043f\u0456\u0434\u043f\u0438\u0441\u0430\u043d\u0456 \u0414\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0456\u044f \u043d\u0435\u0437\u0430\u043b\u0435\u0436\u043d\u043e\u0441\u0442\u0456 (1776) \u0456 \u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0456\u044f \u0421\u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u0445 \u0428\u0442\u0430\u0442\u0456\u0432 (1787). \u0423\u043d\u0456\u0432\u0435\u0440\u0441\u0430\u043b\u044c\u043d\u0456 \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u0438 \u0441\u0432\u043e\u0431\u043e\u0434\u0438 \u0442\u0430 \u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0456\u0457, \u0432\u0438\u043a\u043b\u0430\u0434\u0435\u043d\u0456 \u0432 \u0446\u0438\u0445 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0445, \u043c\u0430\u044e\u0442\u044c \u0444\u0443\u043d\u0434\u0430\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0434\u043b\u044f \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u044c\u043a\u043e\u0457 \u0456\u0441\u0442\u043e\u0440\u0456\u0457, \u0430 \u0442\u0430\u043a\u043e\u0436 \u043c\u0430\u043b\u0438 \u0433\u043b\u0438\u0431\u043e\u043a\u0438\u0439 \u0432\u043f\u043b\u0438\u0432 \u043d\u0430 \u0437\u0430\u043a\u043e\u043d\u043e\u0434\u0430\u0432\u0446\u0456\u0432 \u0443 \u0432\u0441\u044c\u043e\u043c\u0443 \u0441\u0432\u0456\u0442\u0456."},{"year1":"1979","title1":"\u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u0413\u0440\u0430\u043d\u0434-\u041a\u0430\u043d\u044c\u0439\u043e\u043d","text1":"\u0412\u0438\u0440\u0456\u0437\u0430\u043d\u0438\u0439 \u0440\u0456\u0447\u043a\u043e\u044e \u041a\u043e\u043b\u043e\u0440\u0430\u0434\u043e \u0412\u0435\u043b\u0438\u043a\u0438\u0439 \u041a\u0430\u043d\u044c\u0439\u043e\u043d (\u0433\u043b\u0438\u0431\u0438\u043d\u043e\u044e \u043c\u0430\u0439\u0436\u0435 1500 \u043c) \u0454 \u043d\u0430\u0439\u0434\u0438\u0432\u043e\u0432\u0438\u0436\u043d\u0456\u0448\u043e\u044e \u0443\u0449\u0435\u043b\u0438\u043d\u043e\u044e \u0443 \u0441\u0432\u0456\u0442\u0456. \u0420\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0430 \u0432 \u0448\u0442\u0430\u0442\u0456 \u0410\u0440\u0456\u0437\u043e\u043d\u0430, \u0432\u043e\u043d\u0430 \u043f\u0440\u043e\u0440\u0456\u0437\u0430\u0454 \u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u0413\u0440\u0430\u043d\u0434-\u041a\u0430\u043d\u044c\u0439\u043e\u043d. \u0419\u043e\u0433\u043e \u0433\u043e\u0440\u0438\u0437\u043e\u043d\u0442\u0430\u043b\u044c\u043d\u0456 \u0448\u0430\u0440\u0438 \u0432\u0456\u0434\u0441\u0442\u0435\u0436\u0443\u044e\u0442\u044c \u0433\u0435\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0443 \u0456\u0441\u0442\u043e\u0440\u0456\u044e \u043e\u0441\u0442\u0430\u043d\u043d\u0456\u0445 2 \u043c\u0456\u043b\u044c\u044f\u0440\u0434\u0456\u0432 \u0440\u043e\u043a\u0456\u0432. \u0406\u0441\u043d\u0443\u044e\u0442\u044c \u0442\u0430\u043a\u043e\u0436 \u0434\u043e\u0456\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u0456 \u0441\u043b\u0456\u0434\u0438 \u0430\u0434\u0430\u043f\u0442\u0430\u0446\u0456\u0457 \u043b\u044e\u0434\u0438\u043d\u0438 \u0434\u043e \u043e\u0441\u043e\u0431\u043b\u0438\u0432\u043e \u0441\u0443\u0432\u043e\u0440\u043e\u0433\u043e \u0441\u0435\u0440\u0435\u0434\u043e\u0432\u0438\u0449\u0430.","year2":"1979","title2":"Kluane / Wrangell-St. Elias / Glacier Bay / Tatshenshini-Alsek","text2":"\u0426\u0456 \u043f\u0430\u0440\u043a\u0438 \u0441\u043a\u043b\u0430\u0434\u0430\u044e\u0442\u044c\u0441\u044f \u0437 \u0432\u0440\u0430\u0436\u0430\u044e\u0447\u043e\u0433\u043e \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u0443 \u043b\u044c\u043e\u0434\u043e\u0432\u0438\u043a\u0456\u0432 \u0456 \u0432\u0438\u0441\u043e\u043a\u0438\u0445 \u0432\u0435\u0440\u0448\u0438\u043d \u043f\u043e \u043e\u0431\u0438\u0434\u0432\u0430 \u0431\u043e\u043a\u0438 \u043a\u043e\u0440\u0434\u043e\u043d\u0443 \u043c\u0456\u0436 \u041a\u0430\u043d\u0430\u0434\u043e\u044e (\u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u044f \u042e\u043a\u043e\u043d \u0456 \u0411\u0440\u0438\u0442\u0430\u043d\u0441\u044c\u043a\u0430 \u041a\u043e\u043b\u0443\u043c\u0431\u0456\u044f) \u0456 \u0421\u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u043c\u0438 \u0428\u0442\u0430\u0442\u0430\u043c\u0438 (\u0410\u043b\u044f\u0441\u043a\u0430). \u0412\u0440\u0430\u0436\u0430\u044e\u0447\u0456 \u043f\u0440\u0438\u0440\u043e\u0434\u043d\u0456 \u043b\u0430\u043d\u0434\u0448\u0430\u0444\u0442\u0438 \u0454 \u0434\u043e\u043c\u043e\u043c \u0434\u043b\u044f \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 \u0432\u0435\u0434\u043c\u0435\u0434\u0456\u0432 \u0433\u0440\u0456\u0437\u043b\u0456, \u043a\u0430\u0440\u0456\u0431\u0443 \u0442\u0430 \u043e\u0432\u0435\u0446\u044c \u0414\u0430\u043b\u043b\u0430. \u041d\u0430 \u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u0457 \u0437\u043d\u0430\u0445\u043e\u0434\u0438\u0442\u044c\u0441\u044f \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448\u0435 \u043d\u0435\u043f\u043e\u043b\u044f\u0440\u043d\u0435 \u043a\u0440\u0438\u0436\u0430\u043d\u0435 \u043f\u043e\u043b\u0435 \u0443 \u0441\u0432\u0456\u0442\u0456."},{"year1":"1980","title1":"\u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u0456 \u0434\u0435\u0440\u0436\u0430\u0432\u043d\u0438\u0439 \u043f\u0430\u0440\u043a\u0438 \u0420\u0435\u0434\u0432\u0443\u0434","text1":"\u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u0420\u0435\u0434\u0432\u0443\u0434 \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u043f\u0440\u0438\u0431\u0435\u0440\u0435\u0436\u043d\u0438\u0445 \u0433\u0456\u0440, \u0449\u043e \u043c\u0435\u0436\u0443\u044e\u0442\u044c \u0437 \u0422\u0438\u0445\u0438\u043c \u043e\u043a\u0435\u0430\u043d\u043e\u043c \u043d\u0430 \u043f\u0456\u0432\u043d\u0456\u0447 \u0432\u0456\u0434 \u0421\u0430\u043d-\u0424\u0440\u0430\u043d\u0446\u0438\u0441\u043a\u043e. \u0412\u0456\u043d \u0432\u043a\u0440\u0438\u0442\u0438\u0439 \u0447\u0443\u0434\u043e\u0432\u0438\u043c \u043b\u0456\u0441\u043e\u043c \u043f\u0440\u0438\u0431\u0435\u0440\u0435\u0436\u043d\u0438\u0445 \u0441\u0435\u043a\u0432\u043e\u0439, \u043d\u0430\u0439\u0432\u0438\u0449\u0438\u0445 \u0456 \u043d\u0430\u0439\u0432\u0440\u0430\u0436\u0430\u044e\u0447\u0438\u0445 \u0434\u0435\u0440\u0435\u0432 \u0443 \u0441\u0432\u0456\u0442\u0456. \u041c\u043e\u0440\u0441\u044c\u043a\u0435 \u0442\u0430 \u043d\u0430\u0437\u0435\u043c\u043d\u0435 \u0436\u0438\u0442\u0442\u044f \u043e\u0434\u043d\u0430\u043a\u043e\u0432\u043e \u0434\u0438\u0432\u043e\u0432\u0438\u0436\u043d\u0456, \u0437\u043e\u043a\u0440\u0435\u043c\u0430 \u043c\u043e\u0440\u0441\u044c\u043a\u0456 \u043b\u0435\u0432\u0438, \u0431\u0456\u043b\u043e\u0433\u043e\u043b\u043e\u0432\u0438\u0439 \u043e\u0440\u043b\u0430\u043d \u0456 \u0437\u043d\u0438\u043a\u0430\u044e\u0447\u0438\u0439 \u043a\u0430\u043b\u0456\u0444\u043e\u0440\u043d\u0456\u0439\u0441\u044c\u043a\u0438\u0439 \u0431\u0443\u0440\u0438\u0439 \u043f\u0435\u043b\u0456\u043a\u0430\u043d.","year2":"1981","title2":"\u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u041c\u0430\u043c\u043e\u043d\u0442\u043e\u0432\u0430 \u043f\u0435\u0447\u0435\u0440\u0430","text2":"\u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u041c\u0430\u043c\u043e\u043d\u0442\u043e\u0432\u0430 \u043f\u0435\u0447\u0435\u0440\u0430, \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u0439 \u0443 \u0448\u0442\u0430\u0442\u0456 \u041a\u0435\u043d\u0442\u0443\u043a\u043a\u0456, \u043c\u0430\u0454 \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448\u0443 \u0432 \u0441\u0432\u0456\u0442\u0456 \u043c\u0435\u0440\u0435\u0436\u0443 \u043f\u0440\u0438\u0440\u043e\u0434\u043d\u0438\u0445 \u043f\u0435\u0447\u0435\u0440 \u0456 \u043f\u0456\u0434\u0437\u0435\u043c\u043d\u0438\u0445 \u0445\u043e\u0434\u0456\u0432, \u044f\u043a\u0456 \u0454 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u043d\u0438\u043c\u0438 \u043f\u0440\u0438\u043a\u043b\u0430\u0434\u0430\u043c\u0438 \u0432\u0430\u043f\u043d\u044f\u043a\u043e\u0432\u0438\u0445 \u0443\u0442\u0432\u043e\u0440\u0435\u043d\u044c. \u041f\u0430\u0440\u043a \u0456 \u0439\u043e\u0433\u043e \u043f\u0456\u0434\u0437\u0435\u043c\u043d\u0430 \u043c\u0435\u0440\u0435\u0436\u0430 \u0437 \u0431\u0456\u043b\u044c\u0448 \u043d\u0456\u0436 560 \u043e\u0431\u0441\u0442\u0435\u0436\u0435\u043d\u0438\u0445 \u043a\u0456\u043b\u043e\u043c\u0435\u0442\u0440\u0456\u0432 \u043f\u0440\u043e\u0445\u043e\u0434\u0456\u0432 \u0454 \u0434\u043e\u043c\u043e\u043c \u0434\u043b\u044f \u0440\u0456\u0437\u043d\u043e\u043c\u0430\u043d\u0456\u0442\u043d\u043e\u0457 \u0444\u043b\u043e\u0440\u0438 \u0456 \u0444\u0430\u0443\u043d\u0438, \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0447\u0438 \u0440\u044f\u0434 \u0432\u0438\u0434\u0456\u0432, \u0449\u043e \u0437\u043d\u0430\u0445\u043e\u0434\u044f\u0442\u044c\u0441\u044f \u043f\u0456\u0434 \u0437\u0430\u0433\u0440\u043e\u0437\u043e\u044e \u0437\u043d\u0438\u043a\u043d\u0435\u043d\u043d\u044f."},{"year1":"1981","title1":"\u041e\u043b\u0456\u043c\u043f\u0456\u0439\u0441\u044c\u043a\u0438\u0439 \u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a","text1":"\u041e\u043b\u0456\u043c\u043f\u0456\u0439\u0441\u044c\u043a\u0438\u0439 \u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a, \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u0439 \u043d\u0430 \u043f\u0456\u0432\u043d\u0456\u0447\u043d\u043e\u043c\u0443 \u0437\u0430\u0445\u043e\u0434\u0456 \u0448\u0442\u0430\u0442\u0443 \u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d, \u0432\u0456\u0434\u043e\u043c\u0438\u0439 \u0440\u0456\u0437\u043d\u043e\u043c\u0430\u043d\u0456\u0442\u043d\u0456\u0441\u0442\u044e \u0441\u0432\u043e\u0457\u0445 \u0435\u043a\u043e\u0441\u0438\u0441\u0442\u0435\u043c. \u0412\u043a\u0440\u0438\u0442\u0456 \u043b\u044c\u043e\u0434\u043e\u0432\u0438\u043a\u0430\u043c\u0438 \u0432\u0435\u0440\u0448\u0438\u043d\u0438, \u044f\u043a\u0456 \u043f\u0435\u0440\u0435\u043c\u0435\u0436\u043e\u0432\u0443\u044e\u0442\u044c\u0441\u044f \u0432\u0435\u043b\u0438\u043a\u0438\u043c\u0438 \u0430\u043b\u044c\u043f\u0456\u0439\u0441\u044c\u043a\u0438\u043c\u0438 \u043b\u0443\u043a\u0430\u043c\u0438, \u043e\u0442\u043e\u0447\u0435\u043d\u0456 \u0432\u0435\u043b\u0438\u043a\u0438\u043c\u0438 \u0441\u0442\u0430\u0440\u0438\u043c\u0438 \u043b\u0456\u0441\u0430\u043c\u0438, \u0441\u0435\u0440\u0435\u0434 \u044f\u043a\u0438\u0445 \u0454 \u043d\u0430\u0439\u043a\u0440\u0430\u0449\u0438\u0439 \u043f\u0440\u0438\u043a\u043b\u0430\u0434 \u043d\u0435\u0437\u0430\u0439\u043c\u0430\u043d\u0438\u0445 \u0456 \u0437\u0430\u0445\u0438\u0449\u0435\u043d\u0438\u0445 \u043f\u043e\u043c\u0456\u0440\u043d\u0438\u0445 \u0442\u0440\u043e\u043f\u0456\u0447\u043d\u0438\u0445 \u043b\u0456\u0441\u0456\u0432 \u043d\u0430 \u043f\u0456\u0432\u043d\u0456\u0447\u043d\u043e\u043c\u0443 \u0437\u0430\u0445\u043e\u0434\u0456 \u0422\u0438\u0445\u043e\u0433\u043e \u043e\u043a\u0435\u0430\u043d\u0443. \u041e\u0434\u0438\u043d\u0430\u0434\u0446\u044f\u0442\u044c \u043e\u0441\u043d\u043e\u0432\u043d\u0438\u0445 \u0440\u0456\u0447\u043a\u043e\u0432\u0438\u0445 \u0441\u0438\u0441\u0442\u0435\u043c \u0434\u0440\u0435\u043d\u0443\u044e\u0442\u044c \u041e\u043b\u0456\u043c\u043f\u0456\u0439\u0441\u044c\u043a\u0456 \u0433\u043e\u0440\u0438, \u043f\u0440\u043e\u043f\u043e\u043d\u0443\u044e\u0447\u0438 \u043e\u0434\u043d\u0456 \u0437 \u043d\u0430\u0439\u043a\u0440\u0430\u0449\u0438\u0445 \u0441\u0435\u0440\u0435\u0434\u043e\u0432\u0438\u0449 \u0456\u0441\u043d\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u0440\u043e\u0445\u0456\u0434\u043d\u0438\u0445 \u0432\u0438\u0434\u0456\u0432 \u0440\u0438\u0431 \u0443 \u043a\u0440\u0430\u0457\u043d\u0456. \u041f\u0430\u0440\u043a \u0442\u0430\u043a\u043e\u0436 \u0432\u043a\u043b\u044e\u0447\u0430\u0454 100 \u043a\u043c \u0431\u0435\u0440\u0435\u0433\u043e\u0432\u043e\u0457 \u043b\u0456\u043d\u0456\u0457 \u0434\u0438\u043a\u043e\u0457 \u043f\u0440\u0438\u0440\u043e\u0434\u0438, \u043d\u0430\u0439\u0434\u043e\u0432\u0448\u043e\u0433\u043e \u043d\u0435\u0437\u0430\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u043e\u0433\u043e \u0443\u0437\u0431\u0435\u0440\u0435\u0436\u0436\u044f \u0432 \u0441\u0443\u043c\u0456\u0436\u043d\u0438\u0445 \u0421\u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u0445 \u0428\u0442\u0430\u0442\u0430\u0445, \u0456 \u0431\u0430\u0433\u0430\u0442\u0438\u0439 \u043c\u0456\u0441\u0446\u0435\u0432\u0438\u043c\u0438 \u0442\u0430 \u0435\u043d\u0434\u0435\u043c\u0456\u0447\u043d\u0438\u043c\u0438 \u0432\u0438\u0434\u0430\u043c\u0438 \u0442\u0432\u0430\u0440\u0438\u043d \u0456 \u0440\u043e\u0441\u043b\u0438\u043d, \u0443 \u0442\u043e\u043c\u0443 \u0447\u0438\u0441\u043b\u0456 \u043a\u0440\u0438\u0442\u0438\u0447\u043d\u043e \u0432\u0430\u0436\u043b\u0438\u0432\u0438\u043c\u0438 \u043f\u043e\u043f\u0443\u043b\u044f\u0446\u0456\u044f\u043c\u0438 \u043f\u0456\u0432\u043d\u0456\u0447\u043d\u043e\u0457 \u043f\u043b\u044f\u043c\u0438\u0441\u0442\u043e\u0457 \u0441\u043e\u0432\u0438, \u043c\u0430\u0440\u043c\u0443\u0440\u043e\u0432\u043e\u0457 \u043c\u0443\u0440\u043b\u0438 \u0442\u0430 \u0444\u043e\u0440\u0435\u043b\u0456, \u0449\u043e \u043f\u0435\u0440\u0435\u0431\u0443\u0432\u0430\u0454 \u043f\u0456\u0434 \u0437\u0430\u0433\u0440\u043e\u0437\u043e\u044e \u0437\u043d\u0438\u043a\u043d\u0435\u043d\u043d\u044f.","year2":"1982","title2":"\u0414\u0435\u0440\u0436\u0430\u0432\u043d\u0435 \u0456\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u0435 \u043c\u0456\u0441\u0446\u0435 \xab\u041a\u0443\u0440\u0433\u0430\u043d\u0438 \u041a\u0430\u0445\u043e\u043a\u0456\u0457\xbb.","text2":"\u041a\u0430\u0445\u043e\u043a\u0456\u044f \u041c\u0430\u0443\u043d\u0434\u0441, \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e \u0432 13 \u043a\u043c \u043d\u0430 \u043f\u0456\u0432\u043d\u0456\u0447\u043d\u0438\u0439 \u0441\u0445\u0456\u0434 \u0432\u0456\u0434 \u0421\u0435\u043d\u0442-\u041b\u0443\u0457\u0441\u0430, \u0448\u0442\u0430\u0442 \u041c\u0456\u0441\u0441\u0443\u0440\u0456, \u0454 \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448\u0438\u043c \u0434\u043e\u043a\u043e\u043b\u0443\u043c\u0431\u043e\u0432\u0438\u043c \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u043d\u044f\u043c \u043d\u0430 \u043f\u0456\u0432\u043d\u0456\u0447 \u0432\u0456\u0434 \u041c\u0435\u043a\u0441\u0438\u043a\u0438. \u0412\u0456\u043d \u0431\u0443\u0432 \u0437\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u0439 \u0432 \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u043c\u0443 \u043f\u0456\u0434 \u0447\u0430\u0441 \u041c\u0456\u0441\u0441\u0456\u0441\u0456\u043f\u0441\u044c\u043a\u043e\u0433\u043e \u043f\u0435\u0440\u0456\u043e\u0434\u0443 (800\u20131400 \u0440\u0440.), \u043a\u043e\u043b\u0438 \u0432\u0456\u043d \u043e\u0445\u043e\u043f\u043b\u044e\u0432\u0430\u0432 \u043c\u0430\u0439\u0436\u0435 1600 \u0433\u0430 \u0456 \u0432\u043a\u043b\u044e\u0447\u0430\u0432 \u0431\u043b\u0438\u0437\u044c\u043a\u043e 120 \u043a\u0443\u0440\u0433\u0430\u043d\u0456\u0432. \u0426\u0435 \u044f\u0441\u043a\u0440\u0430\u0432\u0438\u0439 \u043f\u0440\u0438\u043a\u043b\u0430\u0434 \u0441\u043a\u043b\u0430\u0434\u043d\u043e\u0433\u043e \u0441\u0443\u0441\u043f\u0456\u043b\u044c\u0441\u0442\u0432\u0430 \u0432\u043e\u0436\u0434\u0456\u0432 \u0437 \u0431\u0430\u0433\u0430\u0442\u044c\u043c\u0430 \u0446\u0435\u043d\u0442\u0440\u0430\u043c\u0438 \u043a\u0443\u0440\u0433\u0430\u043d\u0456\u0432-\u0441\u0443\u043f\u0443\u0442\u043d\u0438\u043a\u0456\u0432 \u0456 \u0447\u0438\u0441\u043b\u0435\u043d\u043d\u0438\u043c\u0438 \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u0438\u043c\u0438 \u0445\u0443\u0442\u043e\u0440\u0430\u043c\u0438 \u0442\u0430 \u0441\u0435\u043b\u0430\u043c\u0438. \u0426\u0435 \u0441\u0456\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e\u0441\u043f\u043e\u0434\u0430\u0440\u0441\u044c\u043a\u0435 \u0442\u043e\u0432\u0430\u0440\u0438\u0441\u0442\u0432\u043e \u043c\u043e\u0433\u043b\u043e \u043c\u0430\u0442\u0438 \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u043d\u044f 10\u201320 000 \u043d\u0430 \u043f\u0456\u043a\u0443 \u0441\u0432\u043e\u0433\u043e \u0440\u043e\u0437\u0432\u0438\u0442\u043a\u0443 \u043c\u0456\u0436 1050 \u0456 1150 \u0440\u043e\u043a\u0430\u043c\u0438. \u041e\u0441\u043d\u043e\u0432\u043d\u0456 \u043e\u0431\u2019\u0454\u043a\u0442\u0438 \u0446\u044c\u043e\u0433\u043e \u043c\u0456\u0441\u0446\u044f \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0442\u044c \u041c\u043e\u043d\u043a\u0441-\u041c\u0430\u0443\u043d\u0434, \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448\u0443 \u0434\u043e\u0456\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u0443 \u0437\u0435\u043c\u043b\u044f\u043d\u0443 \u0441\u043f\u043e\u0440\u0443\u0434\u0443 \u0432 \u0410\u043c\u0435\u0440\u0438\u0446\u0456, \u043f\u043b\u043e\u0449\u0435\u044e \u043f\u043e\u043d\u0430\u0434 5 \u0433\u0430 \u0456 \u0432\u0438\u0441\u043e\u0442\u043e\u044e 30 \u043c."},{"year1":"1983","title1":"\u041b\u0430-\u0424\u043e\u0440\u0442\u0430\u043b\u0435\u0437\u0430 \u0442\u0430 \u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0435 \u0456\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u0435 \u043c\u0456\u0441\u0446\u0435 \u0421\u0430\u043d-\u0425\u0443\u0430\u043d \u0443 \u041f\u0443\u0435\u0440\u0442\u043e-\u0420\u0456\u043a\u043e","text1":"\u041c\u0456\u0436 16-\u043c \u0456 20-\u043c \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f\u043c\u0438 \u0432 \u0446\u0456\u0439 \u0441\u0442\u0440\u0430\u0442\u0435\u0433\u0456\u0447\u043d\u0456\u0439 \u0442\u043e\u0447\u0446\u0456 \u0432 \u041a\u0430\u0440\u0438\u0431\u0441\u044c\u043a\u043e\u043c\u0443 \u043c\u043e\u0440\u0456 \u0431\u0443\u043b\u043e \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u043e \u0440\u044f\u0434 \u043e\u0431\u043e\u0440\u043e\u043d\u043d\u0438\u0445 \u0441\u043f\u043e\u0440\u0443\u0434 \u0434\u043b\u044f \u0437\u0430\u0445\u0438\u0441\u0442\u0443 \u043c\u0456\u0441\u0442\u0430 \u0442\u0430 \u0437\u0430\u0442\u043e\u043a\u0438 \u0421\u0430\u043d-\u0425\u0443\u0430\u043d. \u0412\u043e\u043d\u0438 \u044f\u0432\u043b\u044f\u044e\u0442\u044c \u0441\u043e\u0431\u043e\u044e \u0447\u0443\u0434\u043e\u0432\u0443 \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0456\u044e \u0454\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u044c\u043a\u043e\u0457 \u0432\u0456\u0439\u0441\u044c\u043a\u043e\u0432\u043e\u0457 \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u0438, \u0430\u0434\u0430\u043f\u0442\u043e\u0432\u0430\u043d\u043e\u0457 \u0434\u043e \u0433\u0430\u0432\u0430\u043d\u0435\u0439 \u043d\u0430 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u044c\u043a\u043e\u043c\u0443 \u043a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0456.","year2":"1983","title2":"\u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u0413\u0440\u0435\u0439\u0442-\u0421\u043c\u043e\u043a\u0456-\u041c\u0430\u0443\u043d\u0442\u0456\u043d\u0441","text2":"\u0423 \u0446\u044c\u043e\u043c\u0443 \u043d\u0430\u0434\u0437\u0432\u0438\u0447\u0430\u0439\u043d\u043e \u043a\u0440\u0430\u0441\u0438\u0432\u043e\u043c\u0443 \u043f\u0430\u0440\u043a\u0443, \u0449\u043e \u043f\u0440\u043e\u0441\u0442\u044f\u0433\u0430\u0454\u0442\u044c\u0441\u044f \u043d\u0430 \u0431\u0456\u043b\u044c\u0448 \u043d\u0456\u0436 200 000 \u0433\u0430, \u0440\u043e\u0441\u0442\u0435 \u043f\u043e\u043d\u0430\u0434 3500 \u0432\u0438\u0434\u0456\u0432 \u0440\u043e\u0441\u043b\u0438\u043d, \u0443 \u0442\u043e\u043c\u0443 \u0447\u0438\u0441\u043b\u0456 \u043c\u0430\u0439\u0436\u0435 \u0441\u0442\u0456\u043b\u044c\u043a\u0438 \u0436 \u0434\u0435\u0440\u0435\u0432 (130 \u043f\u0440\u0438\u0440\u043e\u0434\u043d\u0438\u0445 \u0432\u0438\u0434\u0456\u0432), \u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0432 \u0443\u0441\u0456\u0439 \u0404\u0432\u0440\u043e\u043f\u0456. \u0422\u0430\u043c \u0442\u0430\u043a\u043e\u0436 \u0437\u0443\u0441\u0442\u0440\u0456\u0447\u0430\u0454\u0442\u044c\u0441\u044f \u0431\u0430\u0433\u0430\u0442\u043e \u0432\u0438\u0434\u0456\u0432 \u0442\u0432\u0430\u0440\u0438\u043d, \u0449\u043e \u0437\u043d\u0430\u0445\u043e\u0434\u044f\u0442\u044c\u0441\u044f \u043f\u0456\u0434 \u0437\u0430\u0433\u0440\u043e\u0437\u043e\u044e \u0437\u043d\u0438\u043a\u043d\u0435\u043d\u043d\u044f, \u0443 \u0442\u043e\u043c\u0443 \u0447\u0438\u0441\u043b\u0456, \u0439\u043c\u043e\u0432\u0456\u0440\u043d\u043e, \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448\u0430 \u0440\u0456\u0437\u043d\u043e\u043c\u0430\u043d\u0456\u0442\u043d\u0456\u0441\u0442\u044c \u0441\u0430\u043b\u0430\u043c\u0430\u043d\u0434\u0440 \u0443 \u0441\u0432\u0456\u0442\u0456. \u041e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u043f\u0430\u0440\u043a \u0454 \u0432\u0456\u0434\u043d\u043e\u0441\u043d\u043e \u043d\u0435\u0434\u043e\u0442\u043e\u0440\u043a\u0430\u043d\u0438\u043c, \u0432\u0456\u043d \u0434\u0430\u0454 \u0443\u044f\u0432\u043b\u0435\u043d\u043d\u044f \u043f\u0440\u043e \u0444\u043b\u043e\u0440\u0443 \u043f\u043e\u043c\u0456\u0440\u043d\u043e\u0433\u043e \u043a\u043b\u0456\u043c\u0430\u0442\u0443 \u0434\u043e \u0432\u043f\u043b\u0438\u0432\u0443 \u043b\u044e\u0434\u0441\u0442\u0432\u0430."},{"year1":"1984","title1":"\u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u0419\u043e\u0441\u0435\u043c\u0456\u0442\u0456","text1":"\u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u0419\u043e\u0441\u0435\u043c\u0456\u0442\u0456 \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u0439 \u0443 \u0441\u0430\u043c\u043e\u043c\u0443 \u0441\u0435\u0440\u0446\u0456 \u041a\u0430\u043b\u0456\u0444\u043e\u0440\u043d\u0456\u0457. \u0417 \u0439\u043e\u0433\u043e \xab\u0432\u0438\u0441\u044f\u0447\u0438\u043c\u0438\xbb \u0434\u043e\u043b\u0438\u043d\u0430\u043c\u0438, \u0447\u0438\u0441\u043b\u0435\u043d\u043d\u0438\u043c\u0438 \u0432\u043e\u0434\u043e\u0441\u043f\u0430\u0434\u0430\u043c\u0438, \u0446\u0438\u0440\u043a\u043e\u0432\u0438\u043c\u0438 \u043e\u0437\u0435\u0440\u0430\u043c\u0438, \u043f\u043e\u043b\u0456\u0440\u043e\u0432\u0430\u043d\u0438\u043c\u0438 \u043a\u0443\u043f\u043e\u043b\u0430\u043c\u0438, \u043c\u043e\u0440\u0435\u043d\u0430\u043c\u0438 \u0442\u0430 U-\u043f\u043e\u0434\u0456\u0431\u043d\u0438\u043c\u0438 \u0434\u043e\u043b\u0438\u043d\u0430\u043c\u0438, \u0432\u0456\u043d \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0443\u0454 \u0447\u0443\u0434\u043e\u0432\u0438\u0439 \u043e\u0433\u043b\u044f\u0434 \u0443\u0441\u0456\u0445 \u0432\u0438\u0434\u0456\u0432 \u0433\u0440\u0430\u043d\u0456\u0442\u043d\u043e\u0433\u043e \u0440\u0435\u043b\u044c\u0454\u0444\u0443, \u0441\u0444\u043e\u0440\u043c\u043e\u0432\u0430\u043d\u043e\u0433\u043e \u0437\u043b\u0435\u0434\u0435\u043d\u0456\u043d\u043d\u044f\u043c. \u041d\u0430 \u0432\u0438\u0441\u043e\u0442\u0456 600\u20134000 \u043c \u0442\u0443\u0442 \u0442\u0430\u043a\u043e\u0436 \u0437\u0443\u0441\u0442\u0440\u0456\u0447\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u043b\u0438\u043a\u0430 \u0440\u0456\u0437\u043d\u043e\u043c\u0430\u043d\u0456\u0442\u043d\u0456\u0441\u0442\u044c \u0444\u043b\u043e\u0440\u0438 \u0442\u0430 \u0444\u0430\u0443\u043d\u0438.","year2":"1984","title2":"\u0421\u0442\u0430\u0442\u0443\u044f \u0421\u0432\u043e\u0431\u043e\u0434\u0438","text2":"\u0417\u0440\u043e\u0431\u043b\u0435\u043d\u0438\u0439 \u0443 \u041f\u0430\u0440\u0438\u0436\u0456 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u044c\u043a\u0438\u043c \u0441\u043a\u0443\u043b\u044c\u043f\u0442\u043e\u0440\u043e\u043c \u0411\u0430\u0440\u0442\u043e\u043b\u044c\u0434\u0456 \u0443 \u0441\u043f\u0456\u0432\u043f\u0440\u0430\u0446\u0456 \u0437 \u0413\u044e\u0441\u0442\u0430\u0432\u043e\u043c \u0415\u0439\u0444\u0435\u043b\u0435\u043c (\u044f\u043a\u0438\u0439 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u0430\u0432 \u0437\u0430 \u0441\u0442\u0430\u043b\u0435\u0432\u0438\u0439 \u043a\u0430\u0440\u043a\u0430\u0441), \u0446\u0435\u0439 \u0432\u0438\u0441\u043e\u043a\u0438\u0439 \u043f\u0430\u043c\u2019\u044f\u0442\u043d\u0438\u043a \u0441\u0432\u043e\u0431\u043e\u0434\u0456 \u0431\u0443\u0432 \u043f\u043e\u0434\u0430\u0440\u0443\u043d\u043a\u043e\u043c \u0432\u0456\u0434 \u0424\u0440\u0430\u043d\u0446\u0456\u0457 \u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u0447\u0447\u044f \u043d\u0435\u0437\u0430\u043b\u0435\u0436\u043d\u043e\u0441\u0442\u0456 \u0410\u043c\u0435\u0440\u0438\u043a\u0438. \u0423\u0440\u043e\u0447\u0438\u0441\u0442\u043e \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u0430 \u0432 1886 \u0440\u043e\u0446\u0456, \u0441\u043a\u0443\u043b\u044c\u043f\u0442\u0443\u0440\u0430 \u0441\u0442\u043e\u0457\u0442\u044c \u0431\u0456\u043b\u044f \u0432\u0445\u043e\u0434\u0443 \u0432 \u0433\u0430\u0432\u0430\u043d\u044c \u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0430 \u0456 \u0437 \u0442\u0438\u0445 \u043f\u0456\u0440 \u043f\u0440\u0438\u0439\u043c\u0430\u0454 \u043c\u0456\u043b\u044c\u0439\u043e\u043d\u0438 \u0456\u043c\u043c\u0456\u0433\u0440\u0430\u043d\u0442\u0456\u0432 \u0434\u043e \u0421\u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u0445 \u0428\u0442\u0430\u0442\u0456\u0432."},{"year1":"1987","title1":"\u041a\u0443\u043b\u044c\u0442\u0443\u0440\u0430 \u0427\u0430\u043a\u043e","text1":"\u041f\u043e\u043d\u0430\u0434 2000 \u0440\u043e\u043a\u0456\u0432 \u043d\u0430\u0440\u043e\u0434\u0438 \u041f\u0443\u0435\u0431\u043b\u043e \u0437\u0430\u0439\u043c\u0430\u043b\u0438 \u0432\u0435\u043b\u0438\u0447\u0435\u0437\u043d\u0438\u0439 \u0440\u0435\u0433\u0456\u043e\u043d \u043d\u0430 \u043f\u0456\u0432\u0434\u0435\u043d\u043d\u043e\u043c\u0443 \u0437\u0430\u0445\u043e\u0434\u0456 \u0421\u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u0445 \u0428\u0442\u0430\u0442\u0456\u0432. \u041a\u0430\u043d\u044c\u0439\u043e\u043d \u0427\u0430\u043a\u043e, \u0433\u043e\u043b\u043e\u0432\u043d\u0438\u0439 \u0446\u0435\u043d\u0442\u0440 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u0438 \u043f\u0440\u0435\u0434\u043a\u0456\u0432 \u041f\u0443\u0435\u0431\u043b\u043e \u043c\u0456\u0436 850 \u0456 1250 \u0440\u043e\u043a\u0430\u043c\u0438, \u0431\u0443\u0432 \u043e\u0441\u0435\u0440\u0435\u0434\u043a\u043e\u043c \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0456\u0430\u043b\u0456\u0432, \u0442\u043e\u0440\u0433\u0456\u0432\u043b\u0456 \u0442\u0430 \u043f\u043e\u043b\u0456\u0442\u0438\u0447\u043d\u043e\u0457 \u0434\u0456\u044f\u043b\u044c\u043d\u043e\u0441\u0442\u0456 \u0432 \u0434\u043e\u0456\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u043e\u043c\u0443 \u0440\u0430\u0439\u043e\u043d\u0456 \u0427\u043e\u0442\u0438\u0440\u0438 \u043a\u0443\u0442\u0438. \u0427\u0430\u043a\u043e \u043f\u0440\u0438\u043c\u0456\u0442\u043d\u0438\u0439 \u0441\u0432\u043e\u0457\u043c\u0438 \u043c\u043e\u043d\u0443\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u0438\u043c\u0438 \u0433\u0440\u043e\u043c\u0430\u0434\u0441\u044c\u043a\u0438\u043c\u0438 \u0442\u0430 \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0456\u0430\u043b\u044c\u043d\u0438\u043c\u0438 \u0431\u0443\u0434\u0456\u0432\u043b\u044f\u043c\u0438 \u0442\u0430 \u0441\u0432\u043e\u0454\u044e \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u043d\u043e\u044e \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u043e\u044e \u2013 \u0442\u0443\u0442 \u0454 \u0441\u0442\u0430\u0440\u043e\u0434\u0430\u0432\u043d\u0456\u0439 \u043c\u0456\u0441\u044c\u043a\u0438\u0439 \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0456\u0430\u043b\u044c\u043d\u0438\u0439 \u0446\u0435\u043d\u0442\u0440, \u044f\u043a\u0438\u0439 \u043d\u0435 \u0441\u0445\u043e\u0436\u0438\u0439 \u043d\u0456 \u043d\u0430 \u0449\u043e, \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u0435 \u0440\u0430\u043d\u0456\u0448\u0435 \u0447\u0438 \u043f\u0456\u0437\u043d\u0456\u0448\u0435. \u041e\u043a\u0440\u0456\u043c \u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0456\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u043e\u0433\u043e \u043f\u0430\u0440\u043a\u0443 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u0438 \u0427\u0430\u043a\u043e, \u043e\u0431\u2019\u0454\u043a\u0442 \u0412\u0441\u0435\u0441\u0432\u0456\u0442\u043d\u044c\u043e\u0457 \u0441\u043f\u0430\u0434\u0449\u0438\u043d\u0438 \u0432\u043a\u043b\u044e\u0447\u0430\u0454 \u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u043c\u2019\u044f\u0442\u043d\u0438\u043a \u0420\u0443\u0457\u043d\u0438 \u0430\u0446\u0442\u0435\u043a\u0456\u0432 \u0456 \u043a\u0456\u043b\u044c\u043a\u0430 \u043c\u0435\u043d\u0448\u0438\u0445 \u043e\u0431\u2019\u0454\u043a\u0442\u0456\u0432 \u0427\u0430\u043a\u043e, \u044f\u043a\u0438\u043c\u0438 \u043a\u0435\u0440\u0443\u0454 \u0411\u044e\u0440\u043e \u0437\u0435\u043c\u043b\u0435\u0443\u0441\u0442\u0440\u043e\u044e.","year2":"1987","title2":"\u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u0413\u0430\u0432\u0430\u0439\u0441\u044c\u043a\u0438\u0445 \u0432\u0443\u043b\u043a\u0430\u043d\u0456\u0432","text2":"\u041d\u0430 \u0446\u044c\u043e\u043c\u0443 \u043c\u0456\u0441\u0446\u0456 \u0437\u043d\u0430\u0445\u043e\u0434\u044f\u0442\u044c\u0441\u044f \u0434\u0432\u0430 \u043d\u0430\u0439\u0430\u043a\u0442\u0438\u0432\u043d\u0456\u0448\u0438\u0445 \u0432\u0443\u043b\u043a\u0430\u043d\u0438 \u0443 \u0441\u0432\u0456\u0442\u0456, \u041c\u0430\u0443\u043d\u0430-\u041b\u043e\u0430 (4170 \u043c \u0437\u0430\u0432\u0432\u0438\u0448\u043a\u0438) \u0456 \u041a\u0456\u043b\u0430\u0443\u0435\u0430 (1250 \u043c \u0437\u0430\u0432\u0432\u0438\u0448\u043a\u0438), \u043e\u0431\u0438\u0434\u0432\u0430 \u0437 \u044f\u043a\u0438\u0445 \u0432\u0438\u0441\u043e\u0447\u0456\u044e\u0442\u044c \u043d\u0430\u0434 \u0422\u0438\u0445\u0438\u043c \u043e\u043a\u0435\u0430\u043d\u043e\u043c. \u0412\u0438\u0432\u0435\u0440\u0436\u0435\u043d\u043d\u044f \u0432\u0443\u043b\u043a\u0430\u043d\u0456\u0432 \u0441\u0442\u0432\u043e\u0440\u0438\u043b\u0438 \u043b\u0430\u043d\u0434\u0448\u0430\u0444\u0442, \u0449\u043e \u043f\u043e\u0441\u0442\u0456\u0439\u043d\u043e \u0437\u043c\u0456\u043d\u044e\u0454\u0442\u044c\u0441\u044f, \u0430 \u043f\u043e\u0442\u043e\u043a\u0438 \u043b\u0430\u0432\u0438 \u0432\u0456\u0434\u043a\u0440\u0438\u0432\u0430\u044e\u0442\u044c \u0434\u0438\u0432\u043e\u0432\u0438\u0436\u043d\u0456 \u0433\u0435\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0456 \u0443\u0442\u0432\u043e\u0440\u0435\u043d\u043d\u044f. \u0422\u0443\u0442 \u0437\u0443\u0441\u0442\u0440\u0456\u0447\u0430\u044e\u0442\u044c\u0441\u044f \u0440\u0456\u0434\u043a\u0456\u0441\u043d\u0456 \u043f\u0442\u0430\u0445\u0438 \u0442\u0430 \u0435\u043d\u0434\u0435\u043c\u0456\u0447\u043d\u0456 \u0432\u0438\u0434\u0438, \u0430 \u0442\u0430\u043a\u043e\u0436 \u043b\u0456\u0441\u0438 \u0433\u0456\u0433\u0430\u043d\u0442\u0441\u044c\u043a\u0438\u0445 \u043f\u0430\u043f\u043e\u0440\u043e\u0442\u0435\u0439."},{"year1":"1987","title1":"\u041c\u043e\u043d\u0442\u0456\u0447\u0435\u043b\u043b\u043e \u0442\u0430 \u0423\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0412\u0456\u0440\u0434\u0436\u0438\u043d\u0456\u0457 \u0432 \u0428\u0430\u0440\u043b\u043e\u0442\u0441\u0432\u0456\u043b\u043b\u0456","text1":"\u0422\u043e\u043c\u0430\u0441 \u0414\u0436\u0435\u0444\u0444\u0435\u0440\u0441\u043e\u043d (1743\u20131826), \u0430\u0432\u0442\u043e\u0440 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u044c\u043a\u043e\u0457 \u0414\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0456\u0457 \u043d\u0435\u0437\u0430\u043b\u0435\u0436\u043d\u043e\u0441\u0442\u0456 \u0442\u0430 \u0442\u0440\u0435\u0442\u0456\u0439 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u0445 \u0428\u0442\u0430\u0442\u0456\u0432, \u0442\u0430\u043a\u043e\u0436 \u0431\u0443\u0432 \u0442\u0430\u043b\u0430\u043d\u043e\u0432\u0438\u0442\u0438\u043c \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u043e\u0440\u043e\u043c \u043d\u0435\u043e\u043a\u043b\u0430\u0441\u0438\u0447\u043d\u0438\u0445 \u0431\u0443\u0434\u0456\u0432\u0435\u043b\u044c. \u0412\u0456\u043d \u0441\u043f\u0440\u043e\u0435\u043a\u0442\u0443\u0432\u0430\u0432 \u041c\u043e\u043d\u0442\u0456\u0447\u0435\u043b\u043b\u043e (1769\u20131809), \u0441\u0432\u0456\u0439 \u0431\u0443\u0434\u0438\u043d\u043e\u043a \u043d\u0430 \u043f\u043b\u0430\u043d\u0442\u0430\u0446\u0456\u0457 \u0442\u0430 \u0441\u0432\u043e\u0454 \u0456\u0434\u0435\u0430\u043b\u044c\u043d\u0435 \xab\u0430\u043a\u0430\u0434\u0435\u043c\u0456\u0447\u043d\u0435 \u0441\u0435\u043b\u043e\xbb (1817\u20131826), \u044f\u043a\u0435 \u0434\u043e\u0441\u0456 \u0454 \u0441\u0435\u0440\u0446\u0435\u043c \u0423\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0443 \u0412\u0456\u0440\u0434\u0436\u0438\u043d\u0456\u0457. \u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0414\u0436\u0435\u0444\u0444\u0435\u0440\u0441\u043e\u043d\u043e\u043c \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u043e\u0433\u043e \u0441\u043b\u043e\u0432\u043d\u0438\u043a\u0430, \u0437\u0430\u0441\u043d\u043e\u0432\u0430\u043d\u043e\u0433\u043e \u043d\u0430 \u043a\u043b\u0430\u0441\u0438\u0447\u043d\u0456\u0439 \u0430\u043d\u0442\u0438\u0447\u043d\u043e\u0441\u0442\u0456, \u0441\u0438\u043c\u0432\u043e\u043b\u0456\u0437\u0443\u0454 \u044f\u043a \u043f\u0440\u0430\u0433\u043d\u0435\u043d\u043d\u044f \u043d\u043e\u0432\u043e\u0457 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u044c\u043a\u043e\u0457 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0456\u043a\u0438 \u044f\u043a \u0441\u043f\u0430\u0434\u043a\u043e\u0454\u043c\u0446\u044f \u0454\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u044c\u043a\u043e\u0457 \u0442\u0440\u0430\u0434\u0438\u0446\u0456\u0457, \u0442\u0430\u043a \u0456 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u0456 \u0435\u043a\u0441\u043f\u0435\u0440\u0438\u043c\u0435\u043d\u0442\u0438, \u044f\u043a\u0438\u0445 \u043c\u043e\u0436\u043d\u0430 \u0431\u0443\u043b\u043e \u043e\u0447\u0456\u043a\u0443\u0432\u0430\u0442\u0438 \u0432 \u043c\u0456\u0440\u0443 \u0434\u043e\u0440\u043e\u0441\u043b\u0456\u0448\u0430\u043d\u043d\u044f \u043a\u0440\u0430\u0457\u043d\u0438.","year2":"1992","title2":"\u0422\u0430\u043e\u0441 \u041f\u0443\u0435\u0431\u043b\u043e","text2":"\u0420\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0435 \u0432 \u0434\u043e\u043b\u0438\u043d\u0456 \u043d\u0435\u0432\u0435\u043b\u0438\u043a\u043e\u0457 \u043f\u0440\u0438\u0442\u043e\u043a\u0438 \u0420\u0456\u043e-\u0413\u0440\u0430\u043d\u0434\u0435 \u0446\u0435 \u0433\u043b\u0438\u043d\u043e\u0431\u0438\u0442\u043d\u0435 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u043d\u044f, \u0449\u043e \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u0436\u0438\u0442\u043b\u043e\u0432\u0438\u0445 \u0456 \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0456\u0430\u043b\u044c\u043d\u0438\u0445 \u0431\u0443\u0434\u0456\u0432\u0435\u043b\u044c, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0454 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u0443 \u0456\u043d\u0434\u0456\u0430\u043d\u0446\u0456\u0432 \u043f\u0443\u0435\u0431\u043b\u043e \u0432 \u0410\u0440\u0456\u0437\u043e\u043d\u0456 \u0442\u0430 \u041d\u044c\u044e-\u041c\u0435\u043a\u0441\u0438\u043a\u043e."},{"year1":"1995","title1":"\u041c\u0456\u0436\u043d\u0430\u0440\u043e\u0434\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u043c\u0438\u0440\u0443 \u043d\u0430 \u043b\u044c\u043e\u0434\u043e\u0432\u0438\u043a\u0443 \u0412\u043e\u0442\u0435\u0440\u0442\u043e\u043d","text1":"\u0423 1932 \u0440\u043e\u0446\u0456 \u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u0412\u043e\u0442\u0435\u0440\u0442\u043e\u043d-\u041b\u0435\u0439\u043a\u0441 (\u0410\u043b\u044c\u0431\u0435\u0440\u0442\u0430, \u041a\u0430\u043d\u0430\u0434\u0430) \u0431\u0443\u0432 \u043e\u0431\'\u0454\u0434\u043d\u0430\u043d\u0438\u0439 \u0437 \u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u043c \u043f\u0430\u0440\u043a\u043e\u043c \u0413\u043b\u0435\u0439\u0448\u0435\u0440 (\u041c\u043e\u043d\u0442\u0430\u043d\u0430, \u0421\u0428\u0410), \u0443\u0442\u0432\u043e\u0440\u0438\u0432\u0448\u0438 \u043f\u0435\u0440\u0448\u0438\u0439 \u0443 \u0441\u0432\u0456\u0442\u0456 \u041c\u0456\u0436\u043d\u0430\u0440\u043e\u0434\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u043c\u0438\u0440\u0443. \u0420\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u0439 \u043d\u0430 \u043a\u043e\u0440\u0434\u043e\u043d\u0456 \u043c\u0456\u0436 \u0434\u0432\u043e\u043c\u0430 \u043a\u0440\u0430\u0457\u043d\u0430\u043c\u0438 \u0442\u0430 \u043f\u0440\u043e\u043f\u043e\u043d\u0443\u0454 \u0447\u0443\u0434\u043e\u0432\u0456 \u043a\u0440\u0430\u0454\u0432\u0438\u0434\u0438, \u043f\u0430\u0440\u043a \u043d\u0430\u0434\u0437\u0432\u0438\u0447\u0430\u0439\u043d\u043e \u0431\u0430\u0433\u0430\u0442\u0438\u0439 \u043d\u0430 \u0432\u0438\u0434\u0438 \u0440\u043e\u0441\u043b\u0438\u043d \u0456 \u0441\u0441\u0430\u0432\u0446\u0456\u0432, \u0430 \u0442\u0430\u043a\u043e\u0436 \u043f\u0440\u0435\u0440\u0456\u0457, \u043b\u0456\u0441\u0438, \u0430\u043b\u044c\u043f\u0456\u0439\u0441\u044c\u043a\u0456 \u0442\u0430 \u043b\u044c\u043e\u0434\u043e\u0432\u0438\u043a\u043e\u0432\u0456 \u043e\u0441\u043e\u0431\u043b\u0438\u0432\u043e\u0441\u0442\u0456.","year2":"1995","title2":"\u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0430\u0440\u043a \u041a\u0430\u0440\u043b\u0441\u0431\u0430\u0434\u0441\u044c\u043a\u0456 \u043f\u0435\u0447\u0435\u0440\u0438","text2":"\u0426\u0435\u0439 \u043a\u0430\u0440\u0441\u0442\u043e\u0432\u0438\u0439 \u043b\u0430\u043d\u0434\u0448\u0430\u0444\u0442 \u0443 \u0448\u0442\u0430\u0442\u0456 \u041d\u044c\u044e-\u041c\u0435\u043a\u0441\u0438\u043a\u043e \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u043f\u043e\u043d\u0430\u0434 80 \u0432\u0438\u0437\u043d\u0430\u043d\u0438\u0445 \u043f\u0435\u0447\u0435\u0440. \u0412\u043e\u043d\u0438 \u0432\u0438\u0440\u0456\u0437\u043d\u044f\u044e\u0442\u044c\u0441\u044f \u043d\u0435 \u0442\u0456\u043b\u044c\u043a\u0438 \u0441\u0432\u043e\u0457\u043c\u0438 \u0440\u043e\u0437\u043c\u0456\u0440\u0430\u043c\u0438, \u0430\u043b\u0435 \u0439 \u0431\u0430\u0433\u0430\u0442\u0441\u0442\u0432\u043e\u043c, \u0440\u0456\u0437\u043d\u043e\u043c\u0430\u043d\u0456\u0442\u043d\u0456\u0441\u0442\u044e \u0442\u0430 \u043a\u0440\u0430\u0441\u043e\u044e \u0441\u0432\u043e\u0457\u0445 \u043c\u0456\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u0438\u0445 \u0443\u0442\u0432\u043e\u0440\u0435\u043d\u044c. \u041f\u0435\u0447\u0435\u0440\u0430 \u041b\u0435\u0447\u0443\u0433\u0456\u043b\u043b\u0430 \u0432\u0438\u0440\u0456\u0437\u043d\u044f\u0454\u0442\u044c\u0441\u044f \u0437-\u043f\u043e\u043c\u0456\u0436 \u0456\u043d\u0448\u0438\u0445, \u0437\u0430\u0431\u0435\u0437\u043f\u0435\u0447\u0443\u044e\u0447\u0438 \u043f\u0456\u0434\u0437\u0435\u043c\u043d\u0443 \u043b\u0430\u0431\u043e\u0440\u0430\u0442\u043e\u0440\u0456\u044e, \u0434\u0435 \u0433\u0435\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0456 \u0442\u0430 \u0431\u0456\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0456 \u043f\u0440\u043e\u0446\u0435\u0441\u0438 \u043c\u043e\u0436\u043d\u0430 \u0432\u0438\u0432\u0447\u0430\u0442\u0438 \u0432 \u043d\u0435\u0437\u0430\u0439\u043c\u0430\u043d\u0456\u0439 \u043e\u0431\u0441\u0442\u0430\u043d\u043e\u0432\u0446\u0456."},{"year1":"2010","title1":"\u041f\u0430\u043f\u0430\u0445\u0430\u043d\u0430\u0443\u043c\u043e\u043a\u0443\u0430\u043a\u0435\u0430","text1":"\u041f\u0430\u043f\u0430\u0445\u0430\u043d\u0430\u0443\u043c\u043e\u043a\u0443\u0430\u043a\u0435\u0430 \u2014 \u0446\u0435 \u0432\u0435\u043b\u0438\u0447\u0435\u0437\u043d\u0435 \u0456\u0437\u043e\u043b\u044c\u043e\u0432\u0430\u043d\u0435 \u043b\u0456\u043d\u0456\u0439\u043d\u0435 \u0441\u043a\u0443\u043f\u0447\u0435\u043d\u043d\u044f \u043d\u0435\u0432\u0435\u043b\u0438\u043a\u0438\u0445 \u043d\u0438\u0437\u044c\u043a\u043e \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u0445 \u043e\u0441\u0442\u0440\u043e\u0432\u0456\u0432 \u0456 \u0430\u0442\u043e\u043b\u0456\u0432 \u0437 \u043e\u043a\u0435\u0430\u043d\u043e\u043c, \u0449\u043e \u0457\u0445 \u043e\u0442\u043e\u0447\u0443\u0454, \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e \u0437\u0430 250 \u043a\u043c \u043d\u0430 \u043f\u0456\u0432\u043d\u0456\u0447\u043d\u0438\u0439 \u0437\u0430\u0445\u0456\u0434 \u0432\u0456\u0434 \u0433\u043e\u043b\u043e\u0432\u043d\u043e\u0433\u043e \u0413\u0430\u0432\u0430\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0430\u0440\u0445\u0456\u043f\u0435\u043b\u0430\u0433\u0443 \u0442\u0430 \u043f\u0440\u043e\u0441\u0442\u044f\u0433\u0430\u0454\u0442\u044c\u0441\u044f \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e \u043d\u0430 1931 \u043a\u043c. \u0426\u044f \u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u044f \u043c\u0430\u0454 \u0433\u043b\u0438\u0431\u043e\u043a\u0435 \u043a\u043e\u0441\u043c\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0435 \u0442\u0430 \u0442\u0440\u0430\u0434\u0438\u0446\u0456\u0439\u043d\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0434\u043b\u044f \u0436\u0438\u0432\u043e\u0457 \u043a\u043e\u0440\u0456\u043d\u043d\u043e\u0457 \u0433\u0430\u0432\u0430\u0439\u0441\u044c\u043a\u043e\u0457 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u0438, \u044f\u043a \u0441\u0435\u0440\u0435\u0434\u043e\u0432\u0438\u0449\u0435 \u043f\u0440\u0435\u0434\u043a\u0456\u0432, \u044f\u043a \u0432\u0442\u0456\u043b\u0435\u043d\u043d\u044f \u0433\u0430\u0432\u0430\u0439\u0441\u044c\u043a\u043e\u0457 \u043a\u043e\u043d\u0446\u0435\u043f\u0446\u0456\u0457 \u0441\u043f\u043e\u0440\u0456\u0434\u043d\u0435\u043d\u043e\u0441\u0442\u0456 \u043c\u0456\u0436 \u043b\u044e\u0434\u044c\u043c\u0438 \u0442\u0430 \u043f\u0440\u0438\u0440\u043e\u0434\u043d\u0438\u043c \u0441\u0432\u0456\u0442\u043e\u043c, \u0456 \u044f\u043a \u043c\u0456\u0441\u0446\u0435, \u0434\u0435, \u044f\u043a \u0432\u0432\u0430\u0436\u0430\u044e\u0442\u044c, \u0437\u0430\u0440\u043e\u0434\u0436\u0443\u0454\u0442\u044c\u0441\u044f \u0436\u0438\u0442\u0442\u044f \u0456 \u0434\u0435 \u0434\u0443\u0445\u0438 \u043f\u043e\u0432\u0435\u0440\u0442\u0430\u044e\u0442\u044c\u0441\u044f \u043f\u0456\u0441\u043b\u044f \u0441\u043c\u0435\u0440\u0442\u0456. \u041d\u0430 \u0434\u0432\u043e\u0445 \u043e\u0441\u0442\u0440\u043e\u0432\u0430\u0445, \u041d\u0456\u0445\u043e\u0430 \u0442\u0430 \u041c\u0430\u043a\u0443\u043c\u0430\u043d\u0430\u043c\u0430\u043d\u0430, \u0454 \u0430\u0440\u0445\u0435\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0456 \u0437\u0430\u043b\u0438\u0448\u043a\u0438, \u043f\u043e\u0432\u2019\u044f\u0437\u0430\u043d\u0456 \u0437 \u0434\u043e\u0454\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u044c\u043a\u0438\u043c\u0438 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u043d\u044f\u043c\u0438 \u0442\u0430 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f\u043c. \u0412\u0435\u043b\u0438\u043a\u0430 \u0447\u0430\u0441\u0442\u0438\u043d\u0430 \u043f\u0430\u043c\u2019\u044f\u0442\u043d\u0438\u043a\u0430 \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u043f\u0435\u043b\u0430\u0433\u0456\u0447\u043d\u0438\u0445 \u0456 \u0433\u043b\u0438\u0431\u043e\u043a\u043e\u0432\u043e\u0434\u043d\u0438\u0445 \u0441\u0435\u0440\u0435\u0434\u043e\u0432\u0438\u0449 \u0456\u0441\u043d\u0443\u0432\u0430\u043d\u043d\u044f \u0437 \u0442\u0430\u043a\u0438\u043c\u0438 \u043f\u043e\u043c\u0456\u0442\u043d\u0438\u043c\u0438 \u043e\u0441\u043e\u0431\u043b\u0438\u0432\u043e\u0441\u0442\u044f\u043c\u0438, \u044f\u043a \u043f\u0456\u0434\u0432\u043e\u0434\u043d\u0456 \u0433\u043e\u0440\u0438 \u0442\u0430 \u0437\u0430\u0442\u043e\u043f\u043b\u0435\u043d\u0456 \u0431\u0435\u0440\u0435\u0433\u0438, \u0432\u0435\u043b\u0438\u043a\u0456 \u043a\u043e\u0440\u0430\u043b\u043e\u0432\u0456 \u0440\u0438\u0444\u0438 \u0442\u0430 \u043b\u0430\u0433\u0443\u043d\u0438. \u0426\u0435 \u043e\u0434\u043d\u0430 \u0437 \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448\u0438\u0445 \u043c\u043e\u0440\u0441\u044c\u043a\u0438\u0445 \u0437\u0430\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u0445 \u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u0439 (MPA) \u0443 \u0441\u0432\u0456\u0442\u0456.","year2":"2014","title2":"\u041c\u043e\u043d\u0443\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u0456 \u0437\u0435\u043c\u043b\u044f\u043d\u0456 \u0441\u043f\u043e\u0440\u0443\u0434\u0438 \u041f\u043e\u0432\u0435\u0440\u0442\u0456 \u041f\u043e\u0439\u043d\u0442","text2":"\u041c\u043e\u043d\u0443\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u0456 \u0437\u0435\u043c\u043b\u044f\u043d\u0456 \u0441\u043f\u043e\u0440\u0443\u0434\u0438 \u041f\u043e\u0432\u0435\u0440\u0442\u0456-\u041f\u043e\u0439\u043d\u0442 \u043e\u0442\u0440\u0438\u043c\u0430\u043b\u0438 \u0441\u0432\u043e\u044e \u043d\u0430\u0437\u0432\u0443 \u0437\u0430\u0432\u0434\u044f\u043a\u0438 \u043f\u043b\u0430\u043d\u0442\u0430\u0446\u0456\u0457 19-\u0433\u043e \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f \u043d\u0435\u043f\u043e\u0434\u0430\u043b\u0456\u043a \u0432\u0456\u0434 \u0446\u044c\u043e\u0433\u043e \u043c\u0456\u0441\u0446\u044f, \u044f\u043a\u0435 \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0435 \u0432 \u0434\u043e\u043b\u0438\u043d\u0456 \u041d\u0438\u0436\u043d\u044c\u043e\u0457 \u041c\u0456\u0441\u0441\u0456\u0441\u0456\u043f\u0456 \u043d\u0430 \u0434\u0435\u0449\u043e \u043f\u0456\u0434\u0432\u0438\u0449\u0435\u043d\u0456\u0439 \u0456 \u0432\u0443\u0437\u044c\u043a\u0456\u0439 \u043c\u0456\u0441\u0446\u0435\u0432\u043e\u0441\u0442\u0456. \u041a\u043e\u043c\u043f\u043b\u0435\u043a\u0441 \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u043f\u2019\u044f\u0442\u0438 \u043a\u0443\u0440\u0433\u0430\u043d\u0456\u0432, \u0448\u0435\u0441\u0442\u0438 \u043a\u043e\u043d\u0446\u0435\u043d\u0442\u0440\u0438\u0447\u043d\u0438\u0445 \u043d\u0430\u043f\u0456\u0432\u0435\u043b\u0456\u043f\u0442\u0438\u0447\u043d\u0438\u0445 \u0445\u0440\u0435\u0431\u0442\u0456\u0432, \u0440\u043e\u0437\u0434\u0456\u043b\u0435\u043d\u0438\u0445 \u043d\u0435\u0433\u043b\u0438\u0431\u043e\u043a\u0438\u043c\u0438 \u0437\u0430\u043f\u0430\u0434\u0438\u043d\u0430\u043c\u0438 \u0442\u0430 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0457 \u043f\u043b\u043e\u0449\u0456. \u0412\u0456\u043d \u0431\u0443\u0432 \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u0439 \u0456 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0432\u0441\u044f \u0434\u043b\u044f \u0436\u0438\u0442\u043b\u043e\u0432\u0438\u0445 \u0456 \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0456\u0430\u043b\u044c\u043d\u0438\u0445 \u0446\u0456\u043b\u0435\u0439 \u0442\u043e\u0432\u0430\u0440\u0438\u0441\u0442\u0432\u043e\u043c \u043c\u0438\u0441\u043b\u0438\u0432\u0446\u0456\u0432-\u0440\u0438\u0431\u0430\u043b\u043e\u043a \u043c\u0456\u0436 3700 \u0456 3100 \u0440\u043e\u043a\u0430\u043c\u0438 \u0434\u043e \u043d\u0430\u0448\u043e\u0457 \u0435\u0440\u0438. \u0426\u0435 \u0432\u0438\u0434\u0430\u0442\u043d\u0435 \u0434\u043e\u0441\u044f\u0433\u043d\u0435\u043d\u043d\u044f \u0432 \u0437\u0435\u043c\u043b\u044f\u043d\u043e\u043c\u0443 \u0431\u0443\u0434\u0456\u0432\u043d\u0438\u0446\u0442\u0432\u0456 \u0432 \u041f\u0456\u0432\u043d\u0456\u0447\u043d\u0456\u0439 \u0410\u043c\u0435\u0440\u0438\u0446\u0456, \u044f\u043a\u0435 \u0431\u0443\u043b\u043e \u043d\u0435\u043f\u0435\u0440\u0435\u0432\u0435\u0440\u0448\u0435\u043d\u0438\u043c \u043f\u0440\u0438\u043d\u0430\u0439\u043c\u043d\u0456 2000 \u0440\u043e\u043a\u0456\u0432."},{"year1":"2015","title1":"\u041c\u0456\u0441\u0456\u0457 \u0421\u0430\u043d-\u0410\u043d\u0442\u043e\u043d\u0456\u043e","text1":"\u0414\u0456\u043b\u044f\u043d\u043a\u0430 \u043e\u0445\u043e\u043f\u043b\u044e\u0454 \u0433\u0440\u0443\u043f\u0443 \u0437 \u043f\u2019\u044f\u0442\u0438 \u043f\u0440\u0438\u043a\u043e\u0440\u0434\u043e\u043d\u043d\u0438\u0445 \u043c\u0456\u0441\u0456\u0439\u043d\u0438\u0445 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u0456\u0432, \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u0445 \u0443\u0437\u0434\u043e\u0432\u0436 \u0434\u0456\u043b\u044f\u043d\u043a\u0438 \u0431\u0430\u0441\u0435\u0439\u043d\u0443 \u0440\u0456\u0447\u043a\u0438 \u0421\u0430\u043d-\u0410\u043d\u0442\u043e\u043d\u0456\u043e \u043d\u0430 \u043f\u0456\u0432\u0434\u043d\u0456 \u0422\u0435\u0445\u0430\u0441\u0443, \u0430 \u0442\u0430\u043a\u043e\u0436 \u0440\u0430\u043d\u0447\u043e, \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0435 \u0437\u0430 37 \u043a\u0456\u043b\u043e\u043c\u0435\u0442\u0440\u0456\u0432 \u043d\u0430 \u043f\u0456\u0432\u0434\u0435\u043d\u044c. \u0412\u0456\u043d \u0432\u043a\u043b\u044e\u0447\u0430\u0454 \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u0456 \u0442\u0430 \u0430\u0440\u0445\u0435\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0456 \u0441\u043f\u043e\u0440\u0443\u0434\u0438, \u0441\u0456\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e\u0441\u043f\u043e\u0434\u0430\u0440\u0441\u044c\u043a\u0456 \u0443\u0433\u0456\u0434\u0434\u044f, \u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0446\u0456\u0457, \u0446\u0435\u0440\u043a\u0432\u0438 \u0442\u0430 \u0437\u0435\u0440\u043d\u043e\u0441\u0445\u043e\u0432\u0438\u0449\u0430, \u0430 \u0442\u0430\u043a\u043e\u0436 \u0441\u0438\u0441\u0442\u0435\u043c\u0438 \u0440\u043e\u0437\u043f\u043e\u0434\u0456\u043b\u0443 \u0432\u043e\u0434\u0438. \u041a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u0438 \u0431\u0443\u043b\u0438 \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u0456 \u0444\u0440\u0430\u043d\u0446\u0438\u0441\u043a\u0430\u043d\u0441\u044c\u043a\u0438\u043c\u0438 \u043c\u0456\u0441\u0456\u043e\u043d\u0435\u0440\u0430\u043c\u0438 \u0443 18 \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u0456 \u0442\u0430 \u0456\u043b\u044e\u0441\u0442\u0440\u0443\u044e\u0442\u044c \u0437\u0443\u0441\u0438\u043b\u043b\u044f \u0456\u0441\u043f\u0430\u043d\u0441\u044c\u043a\u043e\u0457 \u043a\u043e\u0440\u043e\u043d\u0438 \u0437 \u043a\u043e\u043b\u043e\u043d\u0456\u0437\u0430\u0446\u0456\u0457, \u0454\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0437\u0430\u0446\u0456\u0457 \u0442\u0430 \u0437\u0430\u0445\u0438\u0441\u0442\u0443 \u043f\u0456\u0432\u043d\u0456\u0447\u043d\u043e\u0433\u043e \u043a\u043e\u0440\u0434\u043e\u043d\u0443 \u041d\u043e\u0432\u043e\u0457 \u0406\u0441\u043f\u0430\u043d\u0456\u0457. \u041c\u0456\u0441\u0456\u0457 \u0421\u0430\u043d-\u0410\u043d\u0442\u043e\u043d\u0456\u043e \u0442\u0430\u043a\u043e\u0436 \u0454 \u043f\u0440\u0438\u043a\u043b\u0430\u0434\u043e\u043c \u043f\u0435\u0440\u0435\u043f\u043b\u0435\u0442\u0435\u043d\u043d\u044f \u0456\u0441\u043f\u0430\u043d\u0441\u044c\u043a\u043e\u0457 \u0442\u0430 \u043a\u043e\u0430\u0443\u0457\u043b\u044c\u0442\u0435\u043a\u0430\u043d\u0441\u044c\u043a\u043e\u0457 \u043a\u0443\u043b\u044c\u0442\u0443\u0440, \u0449\u043e \u043f\u0440\u043e\u0456\u043b\u044e\u0441\u0442\u0440\u043e\u0432\u0430\u043d\u043e \u0440\u0456\u0437\u043d\u0438\u043c\u0438 \u043e\u0441\u043e\u0431\u043b\u0438\u0432\u043e\u0441\u0442\u044f\u043c\u0438, \u0437\u043e\u043a\u0440\u0435\u043c\u0430 \u0434\u0435\u043a\u043e\u0440\u0430\u0442\u0438\u0432\u043d\u0438\u043c\u0438 \u0435\u043b\u0435\u043c\u0435\u043d\u0442\u0430\u043c\u0438 \u0446\u0435\u0440\u043a\u043e\u0432, \u044f\u043a\u0456 \u043f\u043e\u0454\u0434\u043d\u0443\u044e\u0442\u044c \u043a\u0430\u0442\u043e\u043b\u0438\u0446\u044c\u043a\u0443 \u0441\u0438\u043c\u0432\u043e\u043b\u0456\u043a\u0443 \u0437 \u043c\u0456\u0441\u0446\u0435\u0432\u0438\u043c \u0434\u0438\u0437\u0430\u0439\u043d\u043e\u043c, \u043d\u0430\u0442\u0445\u043d\u0435\u043d\u043d\u0438\u043c \u043f\u0440\u0438\u0440\u043e\u0434\u043e\u044e.","year2":"2019","title2":"\u0410\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u0430 20-\u0433\u043e \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f \u0424\u0440\u0435\u043d\u043a\u0430 \u041b\u043b\u043e\u0439\u0434\u0430 \u0420\u0430\u0439\u0442\u0430","text2":"\u0412\u043b\u0430\u0441\u043d\u0456\u0441\u0442\u044c \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u0432\u043e\u0441\u044c\u043c\u0438 \u0431\u0443\u0434\u0456\u0432\u0435\u043b\u044c \u0443 \u0421\u043f\u043e\u043b\u0443\u0447\u0435\u043d\u0438\u0445 \u0428\u0442\u0430\u0442\u0430\u0445, \u0441\u043f\u0440\u043e\u0435\u043a\u0442\u043e\u0432\u0430\u043d\u0438\u0445 \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u043e\u0440\u043e\u043c \u0443 \u043f\u0435\u0440\u0448\u0456\u0439 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0456 20 \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f. \u0421\u0435\u0440\u0435\u0434 \u043d\u0438\u0445 \u0442\u0430\u043a\u0456 \u0432\u0456\u0434\u043e\u043c\u0456 \u043f\u0440\u043e\u0435\u043a\u0442\u0438, \u044f\u043a Fallingwater (Mill Run, \u041f\u0435\u043d\u0441\u0456\u043b\u044c\u0432\u0430\u043d\u0456\u044f) \u0456 \u041c\u0443\u0437\u0435\u0439 \u0413\u0443\u0433\u0433\u0435\u043d\u0445\u0430\u0439\u043c\u0430 (\u041d\u044c\u044e-\u0419\u043e\u0440\u043a). \u0423\u0441\u0456 \u0431\u0443\u0434\u0456\u0432\u043b\u0456 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u044e\u0442\u044c \xab\u043e\u0440\u0433\u0430\u043d\u0456\u0447\u043d\u0443 \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u0443\xbb, \u0440\u043e\u0437\u0440\u043e\u0431\u043b\u0435\u043d\u0443 \u0420\u0430\u0439\u0442\u043e\u043c, \u044f\u043a\u0430 \u0432\u043a\u043b\u044e\u0447\u0430\u0454 \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u0435 \u043f\u043b\u0430\u043d\u0443\u0432\u0430\u043d\u043d\u044f, \u0440\u043e\u0437\u043c\u0438\u0432\u0430\u043d\u043d\u044f \u043c\u0435\u0436 \u043c\u0456\u0436 \u0435\u043a\u0441\u0442\u0435\u0440\u2019\u0454\u0440\u043e\u043c \u0456 \u0456\u043d\u0442\u0435\u0440\u2019\u0454\u0440\u043e\u043c \u0456 \u0431\u0435\u0437\u043f\u0440\u0435\u0446\u0435\u0434\u0435\u043d\u0442\u043d\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0442\u0430\u043a\u0438\u0445 \u043c\u0430\u0442\u0435\u0440\u0456\u0430\u043b\u0456\u0432, \u044f\u043a \u0441\u0442\u0430\u043b\u044c \u0456 \u0431\u0435\u0442\u043e\u043d. \u041a\u043e\u0436\u043d\u0430 \u0437 \u0446\u0438\u0445 \u0431\u0443\u0434\u0456\u0432\u0435\u043b\u044c \u043f\u0440\u043e\u043f\u043e\u043d\u0443\u0454 \u0456\u043d\u043d\u043e\u0432\u0430\u0446\u0456\u0439\u043d\u0456 \u0440\u0456\u0448\u0435\u043d\u043d\u044f \u0434\u043b\u044f \u043f\u043e\u0442\u0440\u0435\u0431 \u0436\u0438\u0442\u043b\u0430, \u0431\u043e\u0433\u043e\u0441\u043b\u0443\u0436\u0456\u043d\u043d\u044f, \u0440\u043e\u0431\u043e\u0442\u0438 \u0447\u0438 \u0432\u0456\u0434\u043f\u043e\u0447\u0438\u043d\u043a\u0443. \u0422\u0432\u043e\u0440\u0447\u0456\u0441\u0442\u044c \u0420\u0430\u0439\u0442\u0430 \u0446\u044c\u043e\u0433\u043e \u043f\u0435\u0440\u0456\u043e\u0434\u0443 \u043c\u0430\u043b\u0430 \u0441\u0438\u043b\u044c\u043d\u0438\u0439 \u0432\u043f\u043b\u0438\u0432 \u043d\u0430 \u0440\u043e\u0437\u0432\u0438\u0442\u043e\u043a \u0441\u0443\u0447\u0430\u0441\u043d\u043e\u0457 \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u0438 \u0432 \u0404\u0432\u0440\u043e\u043f\u0456."},{"year1":"2023","title1":"\u0423\u0440\u043e\u0447\u0438\u0441\u0442\u0456 \u0437\u0435\u043c\u043b\u044f\u043d\u0456 \u0440\u043e\u0431\u043e\u0442\u0438 Hopewell","text1":"\u0426\u044f \u0432\u043b\u0430\u0441\u043d\u0456\u0441\u0442\u044c \u044f\u0432\u043b\u044f\u0454 \u0441\u043e\u0431\u043e\u044e \u0441\u0435\u0440\u0456\u044e \u0437 \u0432\u043e\u0441\u044c\u043c\u0438 \u043c\u043e\u043d\u0443\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u0438\u0445 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u0456\u0432 \u0437\u0435\u043c\u043b\u044f\u043d\u0438\u0445 \u043e\u0433\u043e\u0440\u043e\u0434\u0436\u0435\u043d\u044c, \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u0438\u0445 \u043c\u0456\u0436 2000 \u0456 1600 \u0440\u043e\u043a\u0430\u043c\u0438 \u0442\u043e\u043c\u0443 \u0432\u0437\u0434\u043e\u0432\u0436 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u0438\u0445 \u043f\u0440\u0438\u0442\u043e\u043a \u0440\u0456\u0447\u043a\u0438 \u041e\u0433\u0430\u0439\u043e. \u0412\u043e\u043d\u0438 \u0454 \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448 \u0440\u0435\u043f\u0440\u0435\u0437\u0435\u043d\u0442\u0430\u0442\u0438\u0432\u043d\u0438\u043c\u0438 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u0438\u043c\u0438 \u0432\u0438\u0440\u0430\u0436\u0435\u043d\u043d\u044f\u043c\u0438 \u0442\u0440\u0430\u0434\u0438\u0446\u0456\u0457 \u043a\u043e\u0440\u0456\u043d\u043d\u043e\u0433\u043e \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u043d\u044f, \u044f\u043a\u0443 \u0437\u0430\u0440\u0430\u0437 \u043d\u0430\u0437\u0438\u0432\u0430\u044e\u0442\u044c \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043e\u044e \u0413\u043e\u0443\u043f\u0432\u0435\u043b\u043b\u0430. \u041f\u0440\u043e \u0457\u0445\u043d\u0456\u0439 \u043c\u0430\u0441\u0448\u0442\u0430\u0431 \u0456 \u0441\u043a\u043b\u0430\u0434\u043d\u0456\u0441\u0442\u044c \u0441\u0432\u0456\u0434\u0447\u0430\u0442\u044c \u0442\u043e\u0447\u043d\u0456 \u0433\u0435\u043e\u043c\u0435\u0442\u0440\u0438\u0447\u043d\u0456 \u0444\u0456\u0433\u0443\u0440\u0438, \u0430 \u0442\u0430\u043a\u043e\u0436 \u0432\u0435\u0440\u0448\u0438\u043d\u0438 \u043f\u0430\u0433\u043e\u0440\u0431\u0456\u0432, \u0441\u043a\u0443\u043b\u044c\u043f\u0442\u0443\u0440\u043d\u043e \u043e\u0433\u043e\u0440\u043e\u0434\u0436\u0435\u043d\u0456 \u0432\u0435\u043b\u0438\u0447\u0435\u0437\u043d\u0438\u043c\u0438 \u0440\u0456\u0432\u043d\u0438\u043c\u0438 \u043f\u043b\u043e\u0449\u0430\u043c\u0438. \u0404 \u0443\u0437\u0433\u043e\u0434\u0436\u0435\u043d\u043d\u044f \u0437 \u0446\u0438\u043a\u043b\u0430\u043c\u0438 \u0421\u043e\u043d\u0446\u044f \u0442\u0430 \u043d\u0430\u0431\u0430\u0433\u0430\u0442\u043e \u0441\u043a\u043b\u0430\u0434\u043d\u0456\u0448\u0438\u043c\u0438 \u0446\u0438\u043a\u043b\u0430\u043c\u0438 \u041c\u0456\u0441\u044f\u0446\u044f. \u0426\u0456 \u0437\u0435\u043c\u043b\u044f\u043d\u0456 \u0443\u043a\u0440\u0456\u043f\u043b\u0435\u043d\u043d\u044f \u0441\u043b\u0443\u0433\u0443\u0432\u0430\u043b\u0438 \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0456\u0430\u043b\u044c\u043d\u0438\u043c\u0438 \u0446\u0435\u043d\u0442\u0440\u0430\u043c\u0438, \u0430 \u043d\u0430 \u0446\u0438\u0445 \u043c\u0456\u0441\u0446\u044f\u0445 \u0431\u0443\u043b\u0438 \u0432\u0438\u044f\u0432\u043b\u0435\u043d\u0456 \u0447\u0443\u0434\u043e\u0432\u043e \u0432\u0438\u0433\u043e\u0442\u043e\u0432\u043b\u0435\u043d\u0456 \u0440\u0438\u0442\u0443\u0430\u043b\u044c\u043d\u0456 \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u0438, \u0432\u0438\u0433\u043e\u0442\u043e\u0432\u043b\u0435\u043d\u0456 \u0437 \u0435\u043a\u0437\u043e\u0442\u0438\u0447\u043d\u043e\u0457 \u0441\u0438\u0440\u043e\u0432\u0438\u043d\u0438, \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u043e\u0457 \u0437 \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u0438\u0445 \u043c\u0456\u0441\u0446\u044c.","year2":"","title2":"","text2":""}]')}}]);